import { BrowserRouter, Route, Link, Switch } from "react-router-dom";
import React, {Component} from "react";
import './App.css';
import DocumentTitle from 'react-document-title'
import FullPriziv from "./fullpriziv";
import Priziv from "./priziv";
import Vibor from "./vibor";
import Back from "./back";
import Komissar from "./komissar";

function App() {
  return (
      <DocumentTitle title = 'Voencomat'>
        <div className="App">
          <BrowserRouter basename="/">
            <Switch>
              <Route exact path="/">
                <Vibor/>
              </Route>
              <Route exact path="/priziv">
                <Priziv/>
                <Back/>
              </Route>
              <Route exact path="/komissar">
                <Komissar/>
                <Back/>
              </Route>
              <Route exact path={`/priziv/:rangeId`}>
                <FullPriziv/>
                <Back/>
              </Route>
            </Switch>
          </BrowserRouter>
        </div>
      </DocumentTitle>
  );
}

export default App;
